  \"Exploratory evaluation of nutrient enrichment and frog response at Conboy Lake
  National Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:04.147607\",\n\t\"name\": \"exploratory-evaluation-of-nutrient-enrichment-and-frog-response-at-conboy-lake-national-wi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We sampled nutrient and water quality parameters
  and surveyed Oregon spotted frogs (Rana pretiosa) life stages (eggs, larvae and
  recently metamorphosed juveniles) to identify the potential for agriculture-related
  nutrient enrichment problems at Conbay Lake NWR., Klickitat County, Washington.
  Aside from the selective conditions (exacerbated summer eutrophication during a
  drought year [2000]), primary nutrients levels (nitrogen and phosphorus) were generally
  low. Values for both nutrients and other water quality parameters were generally
  lower than those recognized as compromising the life stages of western North American
  rancid frogs. Moreoever, available data, suggest no significant problem with euthrophication.
  Nonetheless, Conbay Lake NWR comprises part of a wetland system that exhibits a
  naturally euthrophic cycle that peaks in late summer. With the climate change scenarios,
  predicting increasingly droughty conditions for the region and a high potential
  existing for human development in the Glenwood Valley, at least periodic monitoring
  should be implemented to avoid jeopardizing this largest remaining population of
  Oregon spotted frogs through inadvertent nutrient enrichment.\",\n\t\"license_title\":
